import Layout from '../components/MyLayout';
import {useSelector, useDispatch} from 'react-redux';
import Product from '../components/Product';


	function Show() {
		const this_cart = useSelector(state => state.cart.cart)
		const arr = []
		let hash = {}
		for (let i = 0; i < this_cart.length; i++) {
			console.log(this_cart[i])
			console.log(hash[this_cart[i]] == null)
			if (hash[this_cart[i]] == null) {
				console.log('isnull')
				hash[this_cart[i]] = 1
			}
			else {
				hash[this_cart[i]] = hash[this_cart[i]] + 1
			}
			console.log('HASH')
			console.log(hash)
		}

		for (var key in hash) {
			arr.push({key:hash[key]})
			// console.log(key);
			// console.log(hash[key])
		}
		console.log(arr[0])
		// console.log(arr.map(product => <div>{product.title}</div>))
		return arr.map(product => <Product key={product.title} this_product={product}/>)
		// return <div>Hi</div>

	}

export default function Cart() {
	return (
		<Layout>
			<Show />
		</Layout>
	);
}
